import React, {useEffect, useState} from 'react'
import BasePageWithCard from '../BasePages/BasePageWithCard';
import SupervisedStudentsCard from '../../components/SupervisedStudentsCard/SupervisedStudentsCard'

function SupervisedStudents({teacherData, requestData, schedule_stud_prof, work_protection}) {
  useEffect(() => {
    document.title = "Курируемые выпускники";
  }, []);
console.log(schedule_stud_prof)
  return (
    <BasePageWithCard isAuthenticated={true} data={teacherData}>
    <SupervisedStudentsCard teacherData={teacherData} requestData={requestData} work_schedule={schedule_stud_prof} work_protection={work_protection} />
    </BasePageWithCard>
  )
}

export default SupervisedStudents
